t_appsero_68e00d332046d4314331c2d5be13cdc3_version_info','O:8:\"stdClass\":13:{s:2:\"id\";s:36:\"8f0a1669-b8db-46eb-9fc4-02ac5bfe89e7\";s:4:\"name\";s:9:\"Dokan Pro\";s:4:\"slug\";s:9:\"dokan-pro\";s:6:\"plugin\";s:23:\"dokan-pro/dokan-pro.php\";s:3:\"url\";s:25:\"https://wedevs.com/dokan/\";s:5:\"icons\";a:2:{s:2:\"1x\";s:0:\"\";s:2:\"2x\";s:0:\"\";}s:7:\"banners\";a:2:{s:3:\"low\";s:0:\"\";s:4:\"high\";s:0:\"\";}s:6:\"tested\";s:5:\"5.7.2\";s:12:\"requires_php\";s:3:\"5.6\";s:8:\"requires\";s:3:\"4.8\";s:8:\"sections\";a:2:{s:11:\"description\";s:0:\"\";s:9:\"changelog\";s:33204:\"<h3>3.5.5</h3> <p><em>Release Date – Apr 13, 2022</em></p> <ul> <li> <strong>update:</strong> [VendorVerification] Added vendor proof of residence upload feature</li> <li> <strong>update:</strong> [StoreReview] Added email notification for new store reviews</li> <li> <strong>fix:</strong> Fixed Availability Range of the bookable product can not be deleted when the product is checked to be Accommodation Booking type.</li> <li> <strong>fix:</strong> [Elementor] Fixed some deprecated warnings and a fatal error while using the latest version of Elementor.</li> <li> <strong>fix:</strong> [Booking] Fixed Booking not visible in Day view of the calendar if site language is other than English</li> <li> <strong>fix:</strong> [Geolocation] The product location of the pending review products are automatically changed to same as store on publish has been fixed.</li> <li> <strong>fix:</strong> [VendorSubscription] Vendor are being able to create variations even after restricting using subscription packs has been fixed now.</li> <li> <strong>notice:</strong> added survey notice for dokan pro</li> <li> <strong>fix:</strong> [PayPalMarketplace] Fixed invalid parameter value error while creating vendor subscription if price contain more that 2 digits after decimal points.</li> </ul> <h3>3.5.4</h3> <p><em>Release Date – Mar 18, 2022</em></p> <ul> <li> <strong>fix:</strong> [SPMV] Fatal error under Single Product Multiple Vendor module while trying to clone auction product</li> <li> <strong>fix:</strong> Fixed some translation issue under Vendor Subscription, Vendor Verification, Paypal Marketplace, Mangopay, RazorPay, and Product Advertising module</li> <li> <strong>fix:</strong> [OrderMinMax] Fixed a warning after clicking Order Again on a completed order</li> <li> <strong>fix:</strong> [Product Addons] Completion of successful add-on creation alert message has wrong css class</li> <li> <strong>fix:</strong> Fixed adding two products from different vendors and one of them is virtual, will receive a warning error on the cart page.</li> <li> <strong>fix:</strong> JS console error while loading product category &amp; product add new pages has been fixed</li> <li> <strong>fix:</strong> [PayPal Marketplace] Update seller enable for receive payment status if not already updated due to failed web hook event</li> <li> <strong>fix:</strong> [VendorSubscription] Remove validation if no subscription is active under vendor registration form</li> <li> <strong>fix:</strong> [StoreSupport] fixed get support popup not working properly in single product page if only Store Support module is activated</li> <li> <strong>fix:</strong> [RMA] Send refund button is not working under RMA refund request screen</li> <li> <strong>fix:</strong> [Stripe] \'Your card number is incomplete\' issue on checkout pay order page</li> <li> <strong>fix:</strong> [Booking/Auction] Fixed product geolocation is not working for Booking and Auction Products</li> <li> <strong>fix:</strong> Fixed follow button not working under \'My Account\' &gt; \'Vendors\' section</li> <li> <strong>update:</strong> Set delivery time week start date similar to WordPress week start settings</li> <li> <strong>update:</strong> [MangoPay] Applied some logic to restrict unnecessary implementations for MangoPay</li> <li> <strong>update:</strong> [PayPal Marketplace] Restart Payment flow in case of funding source error on PayPal ie: user doesn’t have enough balance</li> <li> <strong>update:</strong> [PayPal Marketplace] Display user friendly error messages instead of generic message</li> <li> <strong>update:</strong> [PayPal Marketplace] Set Shipping and Tax fee recipient to seller despite of admin settings, previously it was displaying error on checkout page if shipping fee recipient was set to admin</li> <li> <strong>update:</strong> [PayPal Marketplace] Added purchasing capability for not logged in user</li> </ul> <h3>3.5.3</h3> <p><em>Release Date – Mar 8, 2022</em></p> <ul> <li> <strong>update:</strong> Stop loading unnecessary style and script files on every page #1628</li> <li> <strong>update:</strong> [StoreSupport] Added localization support for date time picker library #1783</li> <li> <strong>fix:</strong> vendor info was set to null if vendor haven’t assigned to any store category</li> <li> <strong>fix:</strong> Dokan was creating unnecessary rows in the termmeta table, now has been fixed #1796</li> <li> <strong>fix:</strong> fixed fatal error while checking dokan_is_store_open(), if admin didn\'t run dokan migrator</li> <li> <strong>fix:</strong> fixed fatal error on dokan migrator</li> <li> <strong>fix:</strong> [EU Compliance Fields] Fixed a fatal error while saving Germanized trusted product variation fields data</li> <li> <strong>fix:</strong> [EU Compliance Fields] fatal error on wcpdf invoice integration on php version 8.0+</li> <li> <strong>fix:</strong> [Elementor] Fixed a warning due to compatibility issue with latest version of Store Support Module</li> <li> <strong>fix:</strong> [Elementor] Fixed social profile Elementor icon widget wasn’t working properly due to conflict with latest version of font awesome library #1793</li> <li> <strong>fix:</strong> [StoreReviewe] fixed a fatal error while clicking Sell This Item from spmv module</li> <li> <strong>fix:</strong> [Dokan Stripe] Fixed gateway fee was returning 0 in case of several partial refunds requested for same order #1678</li> <li> <strong>fix:</strong> [Product Enquiry] Fixed loading icon always displaying after product enquiry email is sent #1797</li> </ul> <h3>3.5.2</h3> <p><em>Release Date – Feb 28, 2022</em></p> <ul> <li> <strong>new:</strong> [SPMV] Added product search feature under Add New Product page if Single Product Multi-Vendor module is enabled. #1576</li> <li> <strong>update:</strong> Added seller verification badge under Store listing page, single store page, and single product page #1708</li> <li> <strong>update:</strong> Option to close progress bar if profile completeness score is 100% #1726</li> <li> <strong>update:</strong> [EU Compliance Fields] Added EU Compliance Customer Fields in Order details Billing and Billing section of Customer profile #1724</li> <li> <strong>update:</strong> Module page design updates #1754</li> <li> <strong>fix:</strong> [StoreSupport] Activating Store Support from Modules has no reflection on the single store page unless vendor update their settings #1702</li> <li> <strong>fix:</strong> Tools - Page Installation Pages button does not work appropriately #1719</li> <li> <strong>fix:</strong> Hide add new coupon button from coupon create page #1720</li> <li> <strong>fix:</strong> Shipping continent is not being shown under the shipping tab on the single product page. #1721</li> <li> <strong>fix:</strong> [Booking] Disable shipping option when virtual is enabled for bookable products #1722</li> <li> <strong>fix:</strong> [Booking] Resource available quantity field is empty #1723</li> <li> <strong>fix:</strong> Added Dokan Upgrader to delivery time schema updates #1770</li> <li> <strong>fix:</strong> Styles are not being saved If the announcement is drafted or edited after scheduled #1771</li> <li> <strong>fix:</strong> [Booking] Showing an extra comma in the Booking resource\'s Parent products when a connected product is deleted. #1772</li> </ul> <h3>3.5.1</h3> <p><em>Release Date – Feb 17, 2022</em></p> <ul> <li> <strong>fix:</strong> Multiple store open close time wasn\'t working for Store Open/Close time Widget</li> <li> <strong>fix:</strong> [Elementor] Single Store Page template was missing from Elementor template selection dropdown</li> <li> <strong>fix:</strong> [Elementor] Product Widgets disappeared from Elementor single Product Page template edit panel</li> </ul> <h3>3.5.0</h3> <p><em>Release Date – Feb 3, 2022</em></p> <ul> <li> <p><strong>feat:</strong> [Module] Razorpay Payment Gateway: Accept credit card payments and allow your sellers to get automatic split payment in Dokan via Razorpay</p> </li> <li> <p><strong>feat:</strong> [Module] MangoPay: Enable split payments, multi-seller payments, and other marketplace features given by MangoPay.</p> </li> <li> <p><strong>feat:</strong> [Module] Min Max Quantities: Set a minimum or maximum purchase quantity or amount for the products of your marketplace.</p> </li> <li> <p><strong>feat:</strong> [Module] Product Advertising: Admin can earn more by allowing vendors to advertise their products and give them the right exposure.</p> </li> <li> <p><strong>feat:</strong> [Store Support] Added Store Support for site admin.</p> </li> <li> <p><strong>feat:</strong> Added support for Multiple store open close time for vendor store.</p> </li> <li> <p><strong>feat:</strong> Automatic withdrawal disbursement.</p> </li> <li> <p><strong>feat:</strong> Added custom withdraw method support for admin.</p> </li> <li> <p><strong>update:</strong> Updated design for module page.</p> </li> <li> <p><strong>update:</strong> For Store open close time widget, first day of the week will start on according to the WordPress settings.</p> </li> <li> <p><strong>update:</strong> [Store Support] Design updated on vendor dashboard store support page and customer dashboard support page.</p> </li> <li> <p><strong>update:</strong> Compatibility with latest release of Rank math SEO.</p> </li> <li> <p><strong>update:</strong> [Booking] Added support for &quot;=&quot; symbol while creating range and setting up the cost while creating a bookable product.</p> </li> <li> <p><strong>update:</strong> [Booking] Set the minimum allowed value for \'Minimum booking window ( into the future )\' to zero(0).</p> </li> <li> <p><strong>update:</strong> Updated some admin notices for better readability.</p> </li> <li> <p><strong>update:</strong> [Geolocation] Added a search button under geolocation shortcode to search store/product via geolocation, also removed auto reload features for this form.</p> </li> <li> <p><strong>update:</strong> Updated Dokan Free Shipping minimum amount calculation based on WooCommerce (compatibility with latest version).</p> </li> <li> <p><strong>update:</strong> [StoreSupport] Added date range filtering option for vendor support tickets listing.</p> </li> <li> <p><strong>update:</strong> [StoreSupport] Added support tickets count under My Account page.</p> </li> <li> <p><strong>update:</strong> [ProductEnquiry] reCAPTCHA support added to product enquiry form.</p> </li> <li> <p><strong>update:</strong> [Auction] Added Back Navigation button from auction activity list, also fixed a typo.</p> </li> <li> <p><strong>fix:</strong> Switching subscription plan doesn\'t work if Paypal Marketplace module is active has been fixed.</p> </li> <li> <p><strong>fix:</strong> Coupon was not expiring at exact expiry date.</p> </li> <li> <p><strong>fix:</strong> [DeliveryTime] Delivery date label wasn’t displaying on frontend checkout page, now has been fixed.</p> </li> <li> <p><strong>fix:</strong> Fixed button width mismatch under vendor dashboard report page.</p> </li> <li> <p><strong>fix:</strong> [Auction] Starting bidding price was not resetting for Re-listing auction products, now has been fixed.</p> </li> <li> <p><strong>fix:</strong> Shipping methods are not available when both digital and physical products are in the cart, now has been fixed.</p> </li> <li> <p><strong>fix:</strong> [Product Subscription] Shipping functionality is not working when vendor create subscription product from vendor dashboard, now has been fixed.</p> </li> </ul> <h3>3.4.4</h3> <p><em>Release Date – Dec 23, 2021</em></p> <ul> <li> <strong>fix:</strong> SEO section is not appearing while the latest Yoast SEO plugin (17.8) is installed and activated #1658</li> <li> <strong>fix:</strong> Refund not working if an order has sub order #1656</li> </ul> <h3>3.4.3</h3> <p><em>Release Date – Dec 15, 2021</em></p> <ul> <li> <strong>update:</strong> [Delivery Time] Now users will not be able to choose time slots that are before the order time #1599</li> <li> <strong>update:</strong> [Vendor Subscription] Added sweet alert while canceling a subscription from the vendor dashboard. #1612</li> <li> <strong>update:</strong> Redesigned What’s New page design for Dokan Pro changelog</li> <li> <strong>update:</strong> [Vendor Subscription] Recurring order support added for subscriptions purchased via PayPal Standard Gateway</li> <li> <strong>update:</strong> [Vendor Subscription] Recurring order support added for subscriptions purchased via Dokan Stripe Payment Gateway</li> <li> <strong>refactor:</strong> float typecast refactored to wc_format_decimal() #1448</li> <li> <strong>fix:</strong> [Wholesale] prevent users to buy products at wholesale prices if they are not wholesale customers. #1607</li> <li> <strong>fix:</strong> [Geolocation] Location wasn’t updating if geolocation field was added before and then changed the settings to Same as store. #1615</li> <li> <strong>fix:</strong> Fix loading issue while loading Dokan pages when permalink sets to plain text, Also added a notice to instruct users to change permalink setting. #1621</li> <li> <strong>fix:</strong> [Auction] Start date and End date&quot; fields from the edit auction product page wasn’t saving when users have not previously provided these fields data. #1622</li> <li> <strong>fix:</strong> Show all variation products in admin dashboard -&gt; coupon vendor restriction section #1626</li> <li> <strong>fix:</strong> [Rank Math SEO] Compatibility issue with latest version of Rank Math SEO plugin #1633</li> <li> <strong>fix:</strong> Some string are not translating, now has been fixed #1627</li> <li> <strong>fix:</strong> Fixed Some deprecated warning #1642</li> <li> <strong>fix:</strong> Category dropdown list in Dokan Live Search was invisible in the Dokani theme. added an id to the element to add proper css in the Dokani theme to make it visible #1616</li> <li> <strong>fix:</strong> When variable products are edited using the bulk edit feature of the vendor dashboard, it resets the product status and switches product type to Simple. This issue has been fixed now #1644</li> </ul> <h3>3.4.2</h3> <p><em>Release Date – Nov 30, 2021</em></p> <ul> <li> <strong>new:</strong> [Booking] Added accommodation booking for Booking module</li> <li> <strong>new:</strong> [Table Rate Shipping] Added distance rate shipping under table rate shipping module</li> <li> <strong>new:</strong> [Auction] Added downloadable and virtual product support for auction module</li> <li> <strong>new:</strong> [Store Support] Added searching and filtering for support tickets from vendor dashboard</li> <li> <strong>new:</strong> Added manual refund button for both admin and vendors. Admin and seller can use this feature to record manual refund.</li> <li> <strong>new:</strong> Added a new order note for payment gateways other than Dokan payment gateways.</li> <li> <strong>new:</strong> Added API refund support for payment gateways other than Dokan payment gateways. Based on admin settings, if admin approves a refund request, this will be also processed from corresponding payment gateway.</li> <li> <strong>new:</strong> [Delivery Time] Made delivery time fields required under checkout page, also added a settings page to make these fields required.</li> <li> <strong>update:</strong> Caching Enhancement and Fixes</li> <li> <strong>update:</strong> [Store Support] Display user display name instead of username under Get Support popup form.</li> <li> <strong>update:</strong> [Store Review] Display user display name instead of username under Store Review popup form.</li> <li> <strong>update:</strong> Added necessary tooltip for various Dokan settings.</li> <li> <strong>update:</strong> Replaced vendor dashboard dash icons with fontAwesome icons, this was causing conflict with some third party plugins</li> <li> <strong>fix:</strong> Disabled bulk action product edit/delete, inline product edit/delete if vendor is not enabled for selling</li> <li> <strong>fix:</strong> [Elementor] Fix a conflict with Elementor module and Vendor Analytics module. (Single store page layout was broken)</li> <li> <strong>fix:</strong> [Import/Export] Existing categories wasn’t importing while importing products</li> <li> <strong>fix:</strong> [Store Support] Fixed WPML conflict for various links (some links wasn’t working if site language is other than English)</li> <li> <strong>fix:</strong> Store category search option was throwing error on console</li> <li> <strong>fix:</strong> CSV import form is not working when multisite is enabled</li> <li> <strong>fix:</strong> Saving announcement as draft wasn’t working</li> <li> <strong>fix:</strong> Vendor coupon wasn’t working for variation products</li> </ul> <h3>3.4.1</h3> <p><em>Release Date – Nov 12, 2021</em></p> <ul> <li> <strong>new:</strong> [Vendor Verification] No email sent to vendors after vendor verification status has been changed #1569</li> <li> <strong>new:</strong> Added date filter on Dokan —&gt; Reports —&gt; Logs page #1397</li> <li> <strong>update:</strong> [Geolocation] Reset Geolocation fields data after user clears that fields in WooCommerce shop page #1574</li> <li> <strong>update:</strong> [Vendor Verification] added four new action hooks after verification submit button in vendor dashboard (dokan_before_id_verification_submit_button, dokan_before_phone_verification_submit_button, dokan_before_address_verification_submit_button, dokan_before_company_verification_submit_button) #1572</li> <li> <strong>update:</strong> [Vendor Subscription] Added trial text after trial value on vendor subscription list page #1571</li> <li> <strong>update:</strong> [Auction] some sanitization issue fixed for auction module #1496</li> <li> <strong>update:</strong> Now Export button will export all logs based on applied filters #1397</li> <li> <strong>fix:</strong> [Product Subscription] Added missing param on woocommerce_admin_order_item_headers hooks #1578</li> <li> <strong>fix:</strong> Product variation image upload button wasn’t working due to js error #1575</li> <li> <strong>fix:</strong> [Geolocation] Geolocation fields asking for user address each time user visit shop page #1574</li> <li> <strong>fix:</strong> Fixed WC mail template overwrite wasn’t working #1567</li> <li> <strong>fix:</strong> [Vendor Subscription] fixed Vendor Subscription category limitation doesn\'t work in the quick edit panel.</li> <li> <strong>fix:</strong> Vendor Dashboard created coupon expired date doesn\'t work correctly #1560</li> <li> <strong>fix:</strong> [Import/Export] Fixed importing products does not get the store geolocation data #1475</li> <li> <strong>fix:</strong> \'Connect With Wirecard\' button in vendor payment settings page was hidden, now it is shown #1526</li> </ul> <h3>3.4.0</h3> <p><em>Release Date – Oct 31, 2021</em></p> <ul> <li> <strong>feat:</strong> Added Admin coupon support</li> <li> <strong>feat:</strong> Table Rate Shipping (new module)</li> <li> <strong>feat:</strong> Rank Math SEO Integration (new module)</li> <li> <strong>feat:</strong> Product Bulk Edit feature for vendors/seller</li> <li> <strong>feat:</strong> [Vendor Verification] Company Verification Support for vendors (you need to enable Germanized module also to get this feature)</li> <li> <strong>update:</strong> Added integration of sweetalert2 for alert, prompt, confirm, toast notification</li> <li> <strong>update:</strong> [RMA] WC decimal separator support added in RMA module</li> <li> <strong>update:</strong> Vendor dashborad shipping class suggestion added. dokan-lite issue id no: #1259</li> <li> <strong>update:</strong> [Store Support] added dynamic date time format support for Store Support module</li> <li> <strong>update:</strong> [SMS Verification] Updated Twillio SDK</li> <li> <strong>update:</strong> [WholeSale] Previously vendor and vendor staff does not have the ability to become a wholesale customer, this feature has been added now</li> <li> <strong>update:</strong> [Geolocation] Remove previously added autodetect feature for geolocation module</li> <li> <strong>update:</strong> Prevent vendor to create category. Previously vendors were capable of creating categories while importing product from CSV file.</li> <li> <strong>fix:</strong> [Vendor Staff] Fixed No email is triggered when an user is added form the wp-admin panel Users menu</li> <li> <strong>fix:</strong> Send button collapsed (broken layout) on the RTL version of Dokan —&gt; Announcement —&gt; Add Announcement page</li> <li> <strong>fix:</strong> Fixed tooltips doesn\'t work on the Vendor Dashboard &gt; Orders Edit Page</li> <li> <strong>fix:</strong> New tag wasn’t creating from vendor dashboard product quick edit section</li> </ul> <h3>3.3.9</h3> <p><em>Release Date – Oct 13, 2021</em></p> <ul> <li> <strong>feat:</strong> [Auction] Added auction activity feature for vendors</li> <li> <strong>new:</strong> Added two new filter hooks named dokan_pro_scripts and dokan_load_settings_content_shipping so that some features can be extended via theme authors</li> <li> <strong>update:</strong> [PayPal Marketplace] Added 60+ new country supports for Dokan PayPal Marketplace module.</li> <li> <strong>update:</strong> [Geolocation] Detect user geo location automatically</li> <li> <strong>fix:</strong> [PayPal Marketplace] Vendors, previously, could not purchase any product if they are subscribed to a vendor subscription plan, which has now been fixed</li> <li> <strong>fix:</strong> [Delivery Time] Vendor dashboard’s Store Settings form fields were not saving if the delivery time module was enabled</li> <li> <strong>fix:</strong> [Geolocation] Fixed search filter URL redirect issue. Previously, when a user, submitted the Dokan geolocation filter form, it was redirecting to the current page URL instead of the Store listing page.</li> <li> <strong>fix:</strong> [Product Inquiry] Vendor Contact form didn\'t contain a “Reply-To” email address when a customer would contact a vendor via the product inquiry form. The issue has been resolved now.</li> </ul> <h3>3.3.8</h3> <p><em>Release Date – Oct 4, 2021</em></p> <ul> <li> <strong>fix:</strong> multiple issue fixed in WPML integration with Dokan</li> </ul> <h3>3.3.7</h3> <p><em>Release Date – Sep 30, 2021</em></p> <ul> <li> <strong>feat:</strong> Store Location Pickup: Customers no longer have to wait for their product\'s delivery but rather collect it at their preferable time. They can choose from vendor-provided single or multiple pickup locations during check out and grab their purchases conveniently.</li> <li> <strong>feat:</strong> [PayPal Marketplace] Vendor Subscription support added for Dokan PayPal Marketplace Payment Gateway</li> <li> <strong>new:</strong> [Vendor Subscription] filter subscription by package and by stores</li> <li> <strong>new:</strong> [Vendor Subscription] Sort subscription by start date</li> <li> <strong>new:</strong> [Vendor Subscription] Subscription Relation Type column added under WooCommerce order table, (support added only for Dokan PayPal Marketplace module)</li> <li> <strong>new:</strong> [Vendor Subscription] Subscription Related Orders meta box added under order details page (Support added only for Dokan PayPal Marketplace module)</li> <li> <strong>new:</strong> Added export order permission for staffs, vendors and admins</li> <li> <strong>update:</strong> auto process api refund for orders placed using non dokan payment gateways</li> <li> <strong>update:</strong> [Vendor Analytics] User readable Analytics chart data title added</li> <li> <strong>update:</strong> [Import/Export] sample file download link added in Vendor product CSV import form</li> <li> <strong>update:</strong> Center map on location search in store listing geolocation</li> <li> <strong>fix:</strong> fixed js deprecated warnings on various pages</li> <li> <strong>fix:</strong> [Elementor] multiple deprecated warning fixed</li> <li> <strong>fix:</strong> Refund amount and tax over refund check</li> <li> <strong>fix:</strong> Dokan Pro interference removed from WooCommerce Product Import</li> <li> <strong>fix</strong> [RMA] Fixed multiple warnings.</li> <li> <strong>fix</strong> [RMA] Only display correct/selected refund reason in new RMA request page.</li> <li> <strong>fix:</strong> [RMA] RMA not working for variable product</li> <li> <strong>fix:</strong> Fixed product attribute value sanitization issue</li> <li> <strong>fix:</strong> [Vendor Staff] Remove admin login url from vendor staff email</li> <li> <strong>fix:</strong> hide dokan shipping setting after WPML activation</li> <li> <strong>fix:</strong> SKU not importing when ID field is blank</li> <li> <strong>fix:</strong> Export all button disabled when there is no data in vendor</li> <li> <strong>fix:</strong> Hide product addon settings when creating a grouped product</li> <li> <strong>fix:</strong> Post object and type check when change vendor support topic status</li> </ul> <h3>3.3.6</h3> <p><em>Release Date – Aug 31, 2021</em></p> <ul> <li> <strong>feat:</strong> [Booking] Added manual booking support feature for vendors</li> <li> <strong>new:</strong> Order note for Suborder and main order added when an refund request gets canceled.</li> <li> <strong>new:</strong> Added Net Sale section under vendor dashboard where Total order amount was deducted from the refunded amount</li> <li> <strong>new:</strong> Dokan a new button to get admin setup wizard on tools page</li> <li> <strong>new:</strong> Added Apple Signin feature under Dokan Social Login ( https://wedevs.com/docs/dokan/settings/dokan-social-login/configuring-apple/ )</li> <li> <strong>new:</strong> Added refund request canceled notification email template for vendors</li> <li> <strong>new:</strong> Implemented sorting feature for admin Refund page</li> <li> <strong>fix:</strong> [Booking] fixed Dokan booking details shows wrong order information after admin creates manual booking from WordPress admin panel</li> <li> <strong>fix:</strong> [Elementor] Fixed deprecated warning notice while customising store page with Elementor module</li> <li> <strong>fix:</strong> [Elementor] Fixed WhatsApp doesn\'t get Store Name and URL in Elementor</li> <li> <strong>fix:</strong> Fixed Shipping class amount adding with other shipping class amount issue</li> <li> <strong>fix:</strong> Fixed inconsistency on sales report for refunded order due to caching issue</li> <li> <strong>fix:</strong> [Booking] Display fatal error, after deleting booking product which is associated with any customer.</li> <li> <strong>fix:</strong> [Wholesale] The wholesale price digits next to the comma removes while saving variations from the admin screen</li> <li> <strong>fix:</strong> [Vendor Subscription] Getting error while canceling the Vendor Subscription if subscription order gets deleted</li> <li> <strong>fix:</strong> [Stripe] Fixed last used card number was always stored on stripe non 3ds mode for non-subscription products</li> <li> <strong>fix:</strong> [Product Addons] vendor addon validation applies to all vendors\' products if add to cart url was accessing from browser address bar</li> <li> <strong>fix:</strong> [Vendor Verification] Fixed WordPress site health shows critical issues when the vendor verification module is enabled (PHP Session)</li> <li> <strong>fix:</strong> Fixed Social Login style is broken on the checkout page login form</li> <li> <strong>fix:</strong> Fixed Social API Logins has session Deadlock issues by setting session time to 5 minutes</li> <li> <strong>fix:</strong> Fixed fatal error while changing order status if product has been deleted</li> <li> <strong>fix:</strong> [Product Subscription] Fixed product subscription pagination problem under vendor dashboard</li> <li> <strong>fix:</strong> [Vendor Subscription] Fixed vendors can publish their products under review also</li> <li> <strong>fix:</strong> Admin Refund page search by store name wasn\'t loading refunded list items</li> </ul> <h3>3.3.5</h3> <p><em>Release Date – Aug 16, 2021</em></p> <ul> <li> <strong>fix:</strong> activating module(s) deactivating other active modules</li> </ul> <h3>3.3.4</h3> <p><em>Release Date – Aug 10, 2021</em></p> <ul> <li> <strong>update:</strong> Added translation support for text \'Back to add-on lists\' under html-global-admin-add.php file</li> <li> <strong>update:</strong> Added new Store Support email templates</li> <li> <strong>update</strong> Automatic coupon apply for new products</li> <li> <strong>fix:</strong> vendor subscription pricing table html broken in german translation</li> <li> <strong>fix:</strong> administrator user role added in user search for ShipStation Auth query</li> <li> <strong>fix:</strong> [Dokan Stripe] Card is not saving while purchasing WooCommerce Subscription products (3ds/non3ds)</li> <li> <strong>fix:</strong> Fixed pagination error on Vendor Review page</li> <li> <strong>fix:</strong> fixed couple of translation issue for Booking module.</li> <li> <strong>fix:</strong> Fixed Fatal error: Uncaught Error: Class DokanPro\\Modules\\Subscription\\Helper not found.</li> </ul> <h3>3.3.3</h3> <p><em>Release Date – Aug 2, 2021</em></p> <ul> <li> <strong>New</strong> Pending request validation added in refund request validation.</li> <li> <strong>New</strong> Single validation error message will be displayed during refund request validation failure.</li> <li> <strong>New</strong> Dokan CSV exporter has rewritten to minimize product export errors.</li> <li> <strong>New</strong> Dokan CSV exporter has a new option called variation with variable product export.</li> <li> <strong>New</strong> Dokan CSV Importer has rewritten to minimize product import errors.</li> <li> <strong>New</strong> Dokan Import Export logic will not be imposed during product import export from WooCommerce product export importer.</li> <li> <strong>New</strong> Admin can add new vendor staff from wp-admin users add/edit page</li> <li> <strong>New</strong> [Dokan Auction] Validation error feedback for auction product same SKU</li> <li> <strong>New</strong> [PayPal Marketplace] added a settings fields to get bn code from admin</li> <li> <strong>Update</strong> Pending request validation added in refund</li> <li> <strong>Update</strong> [Vendor Review] Review date time display according to admin selected date time format</li> <li> <strong>Update</strong> [Wirecard] Dokan Wirecard module compatibility with WordPress version 5.8</li> <li> <strong>Fix</strong> [Delivery Time] JS error fix for fresh installation vendor info</li> <li> <strong>Fix</strong> [Wholesale] Product addon and RMA addon not working with wholesale product fixes</li> <li> <strong>Fix</strong> New subscription order is being created for profile save is resolved</li> <li> <strong>Fix</strong> \'Error: dokan is not defined\' in checkout page after transaction is processed via paypal marketplace</li> <li> <strong>Fix</strong> fatal error ‘Class Abstract_Dokan_Background_Processes not found’ while activating dokan lite and pro together</li> </ul> <h3>3.3.2</h3> <p><em>Release Date – Jul 15, 2021</em></p> <ul> <li> <strong>fix:</strong> [PayPal Marketplace] fixed PayPal Marketplace refund conflict with other payment gateway’s refund.</li> <li> <strong>fix:</strong> [Stripe] fixed deduct gateway fee from vendor balance table after a refund is approved via Stripe 3ds and non-3ds</li> <li> <strong>fix:</strong> [Stripe] fixed Stripe non3ds refund is not working if admin commission is set to zero</li> <li> <strong>fix:</strong> fixed Order on Cash on delivery deducting money from Vendor balance while processing Refund</li> </ul> <h3>3.3.1</h3> <p><em>Release Date – Jul 12, 2021</em></p> <ul> <li> <strong>feat:</strong> [New Module] Added a new module named EU Compliance Fields, https://wedevs.com/docs/dokan/modules/eu-compliance-fields/</li> <li> <strong>feat:</strong> [Vendor Subscription] Added Vendor Subscription information section under single vendor edit page</li> <li> <strong>update:</strong> [Vendor Subscription] Hide Create and Add New button if only one product creation is allowed</li> <li> <strong>update:</strong> Added Composer 2 support</li> <li> <strong>fix:</strong> [Vendor Subscription] Fixed create and add new product button redirect according to subscription package allowed product</li> <li> <strong>fix:</strong> [Vendor Subscription] fixed fatal error PHP Fatal error: Uncaught Error: Call to a member function get_allowed_product_categories() on null, while import product from csv if vendor subscription module is active and vendor doesn\'t have any purchased subscription</li> <li> <strong>fix:</strong> [Delivery Time] fixed theme compatibility issues</li> <li> <strong>fix:</strong> [Delivery Time] fixed delivery-time, datepicker is not a function error</li> <li> <strong>fix:</strong> Fixed rewrite rules issues after Dokan Pro plugin is activated for Dokan Pro and all Modules</li> <li> <strong>fix:</strong> [Booking] Fixed Booking calendar styling issue for all-day bookings</li> <li> <strong>fix:</strong> [Elementor] Fixed fatal error on elementor StoreSocialProfile widget</li> </ul>\";}s:11:\"new_version\";s:6:\"3..5.6\";s:12:\"last_updated\";s:19:\"2022-04-26 10:43:31\";}','no'),(2159,'_site_transient_update_plugins','O:8:\"stdClass\":5:{s:12:\"last_checked\";i:1651957633;s:8:\"response\";a:2:{s:51:\"ti-woocommerce-wishlist/ti-woocommerce-w